import React from 'react'
import { Card , Button} from 'react-bootstrap';

export const userProject = (props) => {

console.log(props)
    return (
      (Object.keys(props).includes("ele")) ?
        (<Card style={{ width: '18rem' }}>
        <Card.Img variant="top" style={{ width: '18rem' }} src={props.ele.image} />
        <Card.Body>
    <Card.Title>{props.ele.title}</Card.Title>
          <Card.Text>{props.ele.description}
          </Card.Text>
          <Link to ={props.ele.github }>  gitHub </Link>
    <Button variant="primary" to = {props.ele.github }> {props.ele.github}</Button>
    <Button variant="primary">{props.ele.link}</Button>
        </Card.Body>
      </Card>) : "Loading Data...."
    )
}
export default userProject;
